INSERT INTO providerdiscipline VALUES (1, 3, 1, 2, 4, 'I like marketing and worked in marketing for big companies', 'AWS folder for portfolio');
INSERT INTO providerdiscipline VALUES (2, 3, 5, 1, 4, 'I also like email marketing and have lots of experience', 'AWS folder for portfolio');
INSERT INTO providerdiscipline VALUES (3, 4, 1, 1, 10, 'I listen to you and teach you how to listen to your customers. I want to know, where you want to be, so I can help you make a plan to get you there.', NULL);
INSERT INTO providerdiscipline VALUES (4, 5, 1, 1, 8, 'I conduct qualitative and quantitative market research that will help your company achieve its goals of meeting the current and future needs of its customers.', NULL);
INSERT INTO providerdiscipline VALUES (5, 6, 1, 1, 5, 'Our Insights division is the cornerstone of our company and specializes in building comprehensive plans for traditional and digital marketing strategies.', NULL);
INSERT INTO providerdiscipline VALUES (6, 7, 1, 1, 7, 'I utilize Psychology, Simulation, and Data Analysis, to provide predictive Consumer Insights into the needs of your current and potential customers.', NULL);
INSERT INTO providerdiscipline VALUES (7, 8, 1, 1, 6, 'Companies require strategic solutions that take into consideration the continually changing and complex business landscape. I am able to provide consulting services that look at the complex myriad of cause and effects that will determine how successful a strategy can be.', NULL);
INSERT INTO providerdiscipline VALUES (8, 9, 1, 1, 6, 'Strategies that were once successful can be the very same ones that can cause the rapid decline of a company. I am here to help you identify the strategies that will work for your particular business.', NULL);
INSERT INTO providerdiscipline VALUES (9, 10, 1, 1, 3, 'An online presence is essential in this day and age. We help our clients create a customized digital strategy that is right for them.', NULL);
INSERT INTO providerdiscipline VALUES (10, 11, 1, 1, 3, 'I develop a clear digital strategy that allows you to engage your market in powerful and memorable ways. Most importantly, I help you convert this strategy into action that produces measurable results. ', NULL);
INSERT INTO providerdiscipline VALUES (11, 12, 1, 1, 10, 'Where do I start? How much is it going to cost? Who is the competition? What makes my business unique? These are just some of the questions I can help you answer.', NULL);
INSERT INTO providerdiscipline VALUES (12, 13, 1, 1, 4, 'I specialize in content research, creation, and management of comprehensive marketing plans. With a background in analytics, I am also able to provide inciteful traffic analysis and monthly reports.', NULL);
INSERT INTO providerdiscipline VALUES (13, 14, 1, 2, 10, 'I work in partnership with you to ensure a budget conscious strategy, realistic timeline, and a clear mission statement to ensure that your targeted customer responds.', NULL);
INSERT INTO providerdiscipline VALUES (14, 15, 1, 2, 10, 'We build our strategies around the human element - the psychological impulse of converting someone to a sale.', NULL);
INSERT INTO providerdiscipline VALUES (15, 16, 1, 2, 6, 'With constantly evolving marketing technologies, I help my clients pinpoint which make sense for them and how best to go about implementing them.', NULL);
INSERT INTO providerdiscipline VALUES (16, 17, 1, 2, 3, 'I provide my clients with a plan, a strategy, a realistic forecast to succeed, and a network of people to get it done. ', NULL);
INSERT INTO providerdiscipline VALUES (17, 18, 1, 2, 1, 'With a background in media planning, I can help you create a strategic and extensive advertising strategy to reach your target audience.', NULL);
INSERT INTO providerdiscipline VALUES (18, 19, 1, 2, 6, 'I focus on developing a marketing plan that leverages cross-promotion opportunities with new and existing partners.', NULL);
INSERT INTO providerdiscipline VALUES (19, 20, 1, 2, 10, 'Business owners cite the number one reason for failing to develop a plan is lack of time. We are here to make sure you get your business off on the right foot.', NULL);
INSERT INTO providerdiscipline VALUES (20, 21, 1, 2, 1, 'The number one reason businesses fail to reach full potential is lack of a plan. I am your ideal partner to ensure that doesn’t happen.', NULL);
INSERT INTO providerdiscipline VALUES (21, 22, 1, 2, 3, 'Buyers are willing to pay a premium for businesses with a well-thought-out business plan committed to paper. Let me help you get started.', NULL);
INSERT INTO providerdiscipline VALUES (22, 23, 1, 2, 1, 'I have created entire marketing and branding strategies, advertising campaigns, sales presentations, and custom online marketing campaigns.', NULL);
INSERT INTO providerdiscipline VALUES (23, 24, 1, 3, 4, 'I can help you build and manage successful, long term marketing plans that drive revenue and produce quantifiable results.', NULL);
INSERT INTO providerdiscipline VALUES (24, 25, 1, 3, 8, 'By combining your vision with my experience, we can create a strategy that is sound, attainable, measurable and "nimble."', NULL);
INSERT INTO providerdiscipline VALUES (25, 26, 1, 3, 3, 'I have created marketing campaigns for 1-person start-ups all the way up to large corporations that generate over $500 Million in sales annually.', NULL);
INSERT INTO providerdiscipline VALUES (26, 27, 1, 3, 7, 'Our business plans tackle all of the key components that you will need to address when you start your new business.', NULL);
INSERT INTO providerdiscipline VALUES (27, 28, 1, 3, 4, 'As a marketing professional, my job is to create marketing and advertising campaigns that generate leads and new customers for your business. ', NULL);
INSERT INTO providerdiscipline VALUES (28, 29, 1, 3, 9, 'I specialize in developing customized paid search advertising strategies for eCommerce and software businesses.', NULL);
INSERT INTO providerdiscipline VALUES (29, 30, 1, 3, 9, 'I deliver professional, personalized results in marketing, sales strategy and business consulting. I have worked with some of the largest companies in the world to perform market research and develop plans for the launch of a new product or service.', NULL);
INSERT INTO providerdiscipline VALUES (30, 31, 1, 3, 6, 'Whether It is for a bank, a venture capitalist, private investor, or just your team, we develop unique business plans that speak to your specific audience. ', NULL);
INSERT INTO providerdiscipline VALUES (31, 32, 1, 3, 8, 'My goal is to leave a legacy of assisting entrepreneurs in reaching their full potential. We will start with a marketing plan and take it from there.', NULL);
INSERT INTO providerdiscipline VALUES (32, 33, 1, 3, 10, 'Having managed the marketing efforts of several successful ventures, I am confident I can put an executable plan for success in place for your business.', NULL);
INSERT INTO providerdiscipline VALUES (33, 34, 3, 1, 2, 'Executing a search engine marketing plan that gets results requires a deep understanding of the algorithms behind the major search engines. ', NULL);
INSERT INTO providerdiscipline VALUES (34, 35, 3, 1, 2, 'I will provide you with a full SEO audit and project road map to maximize the digital visibility of your website.', NULL);
INSERT INTO providerdiscipline VALUES (35, 36, 3, 1, 9, 'SEO is critical to the success of your business. Work with us to boost your SERP rankings today.', NULL);
INSERT INTO providerdiscipline VALUES (36, 37, 3, 1, 7, 'Every website is different, hence smart and successful SEO is always customized SEO.', NULL);
INSERT INTO providerdiscipline VALUES (37, 38, 3, 1, 2, 'I create and implement highly customized SEO strategies for my clients’ websites.', NULL);
INSERT INTO providerdiscipline VALUES (38, 39, 3, 1, 3, 'I conduct a profound analysis of your business, aims, competition and various relevant industry elements before developing a search strategy.', NULL);
INSERT INTO providerdiscipline VALUES (39, 40, 3, 1, 3, 'I have managed the search efforts of several successful online ventures so I am confident I can create a campaign that is proven to work for you.', NULL);
INSERT INTO providerdiscipline VALUES (40, 41, 3, 1, 1, 'I analyze your website to ensure its structure and content supports and facilitates your SEO function.', NULL);
INSERT INTO providerdiscipline VALUES (41, 42, 3, 1, 10, 'I am confident that I can deliver the top spot on the SERP for you thanks to my customized SEO strategies that give you the competitive edge you need.', NULL);
INSERT INTO providerdiscipline VALUES (42, 43, 3, 1, 9, 'Regardless of your business type, industry, size and target market, my SEO expertise will help you get results.', NULL);
INSERT INTO providerdiscipline VALUES (43, 44, 3, 2, 4, 'From comprehensive keyword research, sitemap optimization, to internal link structure, I have your SEO function covered.', NULL);
INSERT INTO providerdiscipline VALUES (44, 45, 3, 2, 6, 'Understanding title tagging, internal link structure, and site architecture is not something you should have to worry about.', NULL);
INSERT INTO providerdiscipline VALUES (45, 46, 3, 2, 1, 'I use a combination of high-quality link building and extensive directory submissions to increase your search rankings.', NULL);
INSERT INTO providerdiscipline VALUES (46, 47, 3, 2, 10, 'An optimized site map and directory listings are an essential component of your SEO strategy. I understand these crucial elements inside and out.', NULL);
INSERT INTO providerdiscipline VALUES (47, 48, 3, 2, 2, 'In addition to a customized strategy, I provide comprehensive reporting so you understand exactly what is working and what is not.', NULL);
INSERT INTO providerdiscipline VALUES (48, 49, 3, 2, 2, 'I have been doing SEO for my local clients for 4 years. I understand that you are not just looking for higher rankings, but more customers.', NULL);
INSERT INTO providerdiscipline VALUES (49, 50, 3, 2, 4, 'We understand that you are not interested in the latest SEO gimmicks, but long-term sustainable practices that will build your search rankings over time.', NULL);
INSERT INTO providerdiscipline VALUES (50, 51, 3, 2, 3, 'do not risk getting your website penalized with short-cut SEO gimmicks. I only employ the best "white hat" practices.', NULL);
INSERT INTO providerdiscipline VALUES (51, 52, 3, 2, 7, 'I do not have a one-size-fits-all plan, so you will get my specialized attention for your SEO project needs.', NULL);
INSERT INTO providerdiscipline VALUES (52, 53, 3, 2, 2, 'I understand how SEO really works, not just the latest fad or schemes that are working today.', NULL);
INSERT INTO providerdiscipline VALUES (53, 54, 3, 3, 9, 'The SEO that I do is about what will work next year without getting my sites penalized or slapped.', NULL);
INSERT INTO providerdiscipline VALUES (54, 55, 3, 3, 8, 'I will give you a one-on-one consultation to find out what the best plan of attack is for your specific needs.', NULL);
INSERT INTO providerdiscipline VALUES (55, 56, 3, 3, 2, 'I am an SEO expert and internet marketing specialist with years of experience in online reputation management.', NULL);
INSERT INTO providerdiscipline VALUES (56, 57, 3, 3, 6, 'Bad SEO can actually hurt your website and business. This is why you will receive a tailor made solution for your particular business needs.', NULL);
INSERT INTO providerdiscipline VALUES (57, 58, 3, 3, 2, 'To achieve success, your SEO work has to be relevant and carefully crafted to work in union with all web page factors.', NULL);
INSERT INTO providerdiscipline VALUES (58, 59, 3, 3, 10, 'Relevancy is the best-known secret of successful SEO marketing. I simply make your website more relevant to your target customers.', NULL);
INSERT INTO providerdiscipline VALUES (59, 60, 3, 3, 4, 'SEO techniques are not meant to manipulate a search engine into ranking your pages higher. SEO work is a specialized craft that must be uniquely tailored to your business needs.', NULL);
INSERT INTO providerdiscipline VALUES (60, 61, 3, 3, 9, 'We do the SEO work on your site for you, but we will walk you through every stage of the process so you are always "in the know."', NULL);
INSERT INTO providerdiscipline VALUES (61, 62, 3, 3, 4, 'The very first thing you can expect once you have signed up for our SEO service is a one-on-one consultation targeted to get to know your business and what you are trying to do. ', NULL);
INSERT INTO providerdiscipline VALUES (62, 63, 3, 3, 2, 'Are you sure you are targeting the correct keywords? We can remove that doubt and tell you what keywords are really driving traffic in your industry.', NULL);
INSERT INTO providerdiscipline VALUES (63, 64, 4, 1, 7, 'Driving traffic is easy. Driving highly qualified traffic that converts at a target cost per conversion is hard work.', NULL);
INSERT INTO providerdiscipline VALUES (64, 65, 4, 1, 1, 'I have spent over $250k in one day and managed millions in spend with Google and MSN with great results. ', NULL);
INSERT INTO providerdiscipline VALUES (65, 66, 4, 1, 5, 'We specialize in retail, B2B, education, and manufacturer search marketing services.', NULL);
INSERT INTO providerdiscipline VALUES (66, 67, 4, 1, 2, 'I am a thought leader in the SEM industry and very easy to work with as a freelancer.', NULL);
INSERT INTO providerdiscipline VALUES (67, 68, 4, 1, 6, 'I build, implement, and manage search engine marketing & optimization campaigns from "A-to-Z".', NULL);
INSERT INTO providerdiscipline VALUES (68, 69, 4, 1, 2, 'For my most recent client, I managed $40K per month in ad spend across Google, Bing, LinkedIn & Facebook.', NULL);
INSERT INTO providerdiscipline VALUES (69, 70, 4, 1, 8, 'We tie metrics and reporting into campaign monitoring to provide clients with data needed to determine ROI and overall campaign effectiveness.', NULL);
INSERT INTO providerdiscipline VALUES (70, 71, 4, 1, 4, 'Way back in 2001, I was a pioneer in conversion strategy and online lead generation using Overture.', NULL);
INSERT INTO providerdiscipline VALUES (71, 72, 4, 1, 10, 'I place a constant focus on results and apply a holistic optimization approach.', NULL);
INSERT INTO providerdiscipline VALUES (72, 73, 4, 1, 1, 'What makes me unique is I have spent my own money on Google advertising and I will manage your budget with the same attention and care as I would my own.', NULL);
INSERT INTO providerdiscipline VALUES (73, 74, 4, 2, 2, 'I am highly skilled at diving into Google Analytics and identifying areas of both strength and weakness.', NULL);
INSERT INTO providerdiscipline VALUES (74, 75, 4, 2, 7, 'As an expert in pay-per-click (PPC) management, we save our clients the hassle of managing AdWords and Bing.', NULL);
INSERT INTO providerdiscipline VALUES (75, 76, 4, 2, 4, 'With my job related experience w/Google AdWords, I worked with clients with anywhere from $100 to $100,000 monthly budgets.', NULL);
INSERT INTO providerdiscipline VALUES (76, 77, 4, 2, 3, 'I have worked at agenices where I handled multiple accounts where I was responsible for generating qualified traffic to client sites.', NULL);
INSERT INTO providerdiscipline VALUES (77, 78, 4, 2, 7, 'Whether you already have existing paid search marketing accounts or if you are just looking to get started with paid search, I can help.', NULL);
INSERT INTO providerdiscipline VALUES (78, 79, 4, 2, 6, 'Day-to-day campaign management for multiple paid search marketing accounts, including PPC, display, re-targeting, YouTube, Facebook, Yahoo Stream Ads, and AOL content campaigns.', NULL);
INSERT INTO providerdiscipline VALUES (79, 80, 4, 2, 5, 'We build and launch new search marketing accounts with lead tracking. We develop account performance reports with in-depth analysis and actionable recommendations on next steps.', NULL);
INSERT INTO providerdiscipline VALUES (80, 81, 4, 2, 8, 'I am focused on bid optimization strategy development and execution based on quality keyword portfolios.', NULL);
INSERT INTO providerdiscipline VALUES (81, 82, 4, 2, 6, 'I manage PPC at my day job, so side projects are limited, but I would love the opportunity to work with you if my schedule permits.', NULL);
INSERT INTO providerdiscipline VALUES (82, 83, 4, 2, 6, 'I am well versed in the lastest ad copy writing and testing techiques to get my clients results.', NULL);
INSERT INTO providerdiscipline VALUES (83, 84, 4, 3, 1, 'It is essential to create, test, and execute different search marketing approaches to identify the most cost effective channel for your business.', NULL);
INSERT INTO providerdiscipline VALUES (84, 85, 4, 3, 6, 'I have managed a team of paid search analysts and over $975,000 in paid search spend over the past 6 months.', NULL);
INSERT INTO providerdiscipline VALUES (85, 86, 4, 3, 5, 'I am currently managing the acquisition program for a NYC start-up. This includes paid search, search engine optimization, lead nurturing, and retargeting.', NULL);
